    "from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score, confusion_matrix,roc_curve,auc\n",
    "\n",
    "k_best_features = 5  # Set the number of features you want to select\n",
    "\n",
    "selector = SelectKBest(f_classif, k=k_best_features)\n",
    "\n",
    "# Fit the selector on the training data\n",
    "\n",
    "X_train_selected = selector.fit_transform(X_train, y_train)\n",
    "\n",
    "# Transform the test data\n",
    "\n",
    "X_test_selected = selector.transform(X_test)\n",
    "\n",
    "# Get the indices of the selected features\n",
    "\n",
    "selected_feature_indices = selector.get_support(indices=True)\n",
    "\n",
    "print(selected_feature_indices)\n",
    "\n",
    "all_feature_names = list(df_oversampled.drop(columns=['type']).columns)\n",
    "\n",
    "selected_features = [all_feature_names[i] for i in selected_feature_indices]\n",
    "\n",
    "print(selected_features)\n",
    "\n",
    "# Scatter plot for the selected features\n",
    "\n",
    "\n",
    "for i in range(len(selected_features)):\n",
    "    \n",
    "    for j in range(i + 1, len(selected_features)):\n",
    "        \n",
    "        plt.figure(figsize=(8, 6))\n",
    "        \n",
    "        feature1 = selected_features[i]\n",
    "        \n",
    "        feature2 = selected_features[j]\n",
    "\n",
    "        plt.scatter(X_train[:, i], X_train[:, j], c=y_train, cmap='coolwarm')\n",
    "        \n",
    "        plt.xlabel(feature1,fontsize=16,fontweight='bold')\n",
    "        \n",
    "        plt.ylabel(feature2,fontsize=16,fontweight='bold')\n",
    "        \n",
    "        plt.xticks(fontsize=16,fontweight='bold')\n",
    "        \n",
    "        plt.yticks(fontsize=16,fontweight='bold')\n",
    "        \n",
    "        plt.show()\n",
    "\n",
    "\n",
    "\n",
    "param_grid = {'C': [0.1, 1, 10, 100],\n",
    "              'gamma': [0.01, 0.1, 1],\n",
    "             'degree':[1,2,3]}\n",
    "\n",
    "# Set up the SVM model with an RBF kernel since the plots are non-linear\n",
    "\n",
    "svm_model = SVC(kernel='rbf', C=1, gamma=0.01)  \n",
    "\n",
    "# Perform cross-validation with hyperparameter tuning\n",
    "\n",
    "grid_search = GridSearchCV(svm_model, param_grid, cv=10, scoring='accuracy')\n",
    "\n",
    "grid_search.fit(X_train_selected, y_train)\n",
    "\n",
    "# Print the best parameters found by the grid search\n",
    "\n",
    "print(\"Best Parameters:\", grid_search.best_params_)\n",
    "\n",
    "# Train the SVM model with the best parameters on the entire training set\n",
    "\n",
    "best_svm_model = grid_search.best_estimator_\n",
    "\n",
    "best_svm_model.fit(X_train_selected, y_train)\n",
    "\n",
    "# Make predictions on the test set\n",
    "\n",
    "y_pred = best_svm_model.predict(X_test_selected)\n",
    "\n",
    "# Step 9: Calculate accuracy\n",
    "\n",
    "accuracy = accuracy_score(y_test, y_pred)\n",
    "\n",
    "# Print the accuracy\n",
    "\n",
    "print(f\"Accuracy: {accuracy}\\n\")\n",
    "\n",
    "# Compute and print precision\n",
    "\n",
    "precision = precision_score(y_test, y_pred)\n",
    "\n",
    "print(f'Precision: {precision}')\n",
    "\n",
    "# Compute and print recall\n",
    "\n",
    "recall = recall_score(y_test, y_pred)\n",
    "\n",
    "print(f'Recall: {recall}')\n",
    "\n",
    "# Compute and print F1 score\n",
    "\n",
    "f1 = f1_score(y_test, y_pred)\n",
    "\n",
    "print(f'F1 Score: {f1}')\n",
    "\n",
    "print(\"Classification Report:\\n\")\n",
    "\n",
    "print(classification_report(y_test, y_pred),'\\n')\n",
    "\n",
    "print(\"Confusion Matrix:\")\n",
    "\n",
    "cm = confusion_matrix(y_test, y_pred, labels=best_svm_model.classes_)\n",
    "\n",
    "print(cm)\n",
    "\n",
    "# Calculate false alarm and missed detection rates\n",
    "\n",
    "false_alarm_rate = cm[0, 1] / (cm[0, 0] + cm[0, 1])  # False Positives / (Actual Negatives)\n",
    "\n",
    "missed_detection_rate = cm[1, 0] / (cm[1, 0] + cm[1, 1])  # False Negatives / (Actual Positives)\n",
    "\n",
    "print(f\"\\nFalse Alarm Rate: {false_alarm_rate}\")\n",
    "\n",
    "print(f\"\\nMissed Detection Rate: {missed_detection_rate}\")\n",
    "\n",
    "disp = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=best_svm_model.classes_)\n",
    "\n",
    "disp.plot()\n",
    "\n",
    "plt.show()\n",
    "\n",
    "X_train_k_best_roc=X_train_selected\n",
    "\n",
    "y_train_k_best_roc=y_train\n",
    "\n",
    "model_train_k_best_roc=best_svm_model\n",
    "\n",
    "print(\"\\nROC Curve :\\n\")\n",
    "\n",
    "plt.figure(figsize=(8, 6))\n",
    "\n",
    "RocCurveDisplay.from_estimator(best_svm_model, X_train_selected, y_train)\n",
    "\n",
    "plt.title(\"ROC Curve\")\n",
    "\n",
    "plt.show()"
