    "grid_search.fit(X_train_pca, y_train)\n",
    "\n",
    "# Print the best parameters found by the grid search\n",
    "\n",
    "print(\"Best Parameters:\", grid_search.best_params_)\n",
    "\n",
    "# Train the SVM model with the best parameters on the entire training set\n",
    "\n",
    "best_svm_model = grid_search.best_estimator_\n",
    "\n",
    "best_svm_model.fit(X_train_pca, y_train)\n",
    "\n",
    "# Make predictions on the test set\n",
    "\n",
    "y_pred = best_svm_model.predict(X_test_pca)\n",
    "\n",
    "accuracy = accuracy_score(y_test, y_pred)\n",
    "\n",
    "print(f\"Accuracy: {accuracy}\\n\")\n",
    "\n",
    "from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score, confusion_matrix,roc_curve,auc\n",
    "\n",
    "# Compute and print precision\n",
    "\n",
    "precision = precision_score(y_test, y_pred)\n",
    "\n",
    "print(f'Precision: {precision}')\n",
    "\n",
    "# Compute and print recall\n",
    "\n",
    "recall = recall_score(y_test, y_pred)\n",
    "\n",
    "print(f'Recall: {recall}')\n",
    "\n",
    "# Compute and print F1 score\n",
    "\n",
    "f1 = f1_score(y_test, y_pred)\n",
    "\n",
    "print(f'F1 Score: {f1}')\n",
    "\n",
    "print(\"Classification Report:\\n\")\n",
    "\n",
    "print(classification_report(y_test, y_pred),'\\n')\n",
    "\n",
    "print(\"Confusion Matrix:\")\n",
    "\n",
    "cm = confusion_matrix(y_test, y_pred, labels=best_svm_model.classes_)\n",
    "\n",
    "print(cm)\n",
    "\n",
    "print(f\"Accuracy: {accuracy}\\n\")\n",
    "\n",
    "# Calculate false alarm and missed detection rates\n",
    "\n",
    "false_alarm_rate = cm[0, 1] / (cm[0, 0] + cm[0, 1])  # False Positives / (Actual Negatives)\n",
    "\n",
    "missed_detection_rate = cm[1, 0] / (cm[1, 0] + cm[1, 1])  # False Negatives / (Actual Positives)\n",
    "\n",
    "print(f\"\\nFalse Alarm Rate: {false_alarm_rate}\")\n",
    "\n",
    "print(f\"\\nMissed Detection Rate: {missed_detection_rate}\")\n",
    "\n",
    "disp = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=best_svm_model.classes_)\n",
    "\n",
    "disp.plot()\n",
    "\n",
    "plt.show()\n",
    "\n",
    "X_train_pca_roc=X_train_pca\n",
    "\n",
    "y_train_pca_roc=y_train\n",
    "\n",
    "model_train_pca_roc=svm_model\n",
    "\n",
    "print(\"\\nROC Curve :\\n\")\n",
    "\n",
    "plt.figure(figsize=(8, 6))\n",
    "\n",
    "RocCurveDisplay.from_estimator(best_svm_model, X_train_pca, y_train)\n",
    "\n",
    "plt.title(\"ROC Curve\")\n",
    "\n",
    "plt.show()\n"
