    "from mlxtend.feature_selection import SequentialFeatureSelector as sfs\n",
    "from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score, confusion_matrix,roc_curve,auc\n",
    "\n",
    "clf = RandomForestClassifier()\n",
    "\n",
    "sfs1 = sfs(clf,\n",
    "           k_features=5,\n",
    "           forward=True,\n",
    "           floating=False,\n",
    "           verbose=2,\n",
    "           scoring='accuracy',\n",
    "           cv=9)\n",
    "\n",
    "sfs1 = sfs1.fit(X_train_2, y_train)\n",
    "\n",
    "selected_feature_names = X_train.columns[list(sfs1.k_feature_idx_)]\n",
    "\n",
    "print(\"Selected feature names:\", selected_feature_names)\n",
    "\n",
    "selected_features = list(sfs1.k_feature_idx_)\n",
    "\n",
    "print('selected_features',selected_features)\n",
    "\n",
    "#Scatter Plot\n",
    "\n",
    "for i in range(len(selected_feature_names)):\n",
    "    \n",
    "    for j in range(i + 1, len(selected_feature_names)):\n",
    "        \n",
    "        feature1 = selected_feature_names[i]\n",
    "        \n",
    "        feature2 = selected_feature_names[j]\n",
    "\n",
    "        plt.scatter(X_train[feature1], X_train[feature2], c=y_train, cmap='coolwarm')\n",
    "        \n",
    "        plt.xlabel(feature1)\n",
    "        \n",
    "        plt.ylabel(feature2)\n",
    "        \n",
    "        plt.title(f'Scatter plot for {feature1} vs {feature2}')\n",
    "        \n",
    "        plt.show()\n",
    "\n",
    "# Applying SVM Model\n",
    "\n",
    "svm_model = SVC(kernel='rbf', C=1, gamma='auto')  \n",
    "\n",
    "svm_model.fit(X_train.iloc[:, selected_features], y_train)\n",
    "\n",
    "y_pred = svm_model.predict(X_valid.iloc[:, selected_features])\n",
    "\n",
    "print('\\n\\nFinal Accuracy:', accuracy_score(y_valid, y_pred))\n",
    "\n",
    "# Compute and print precision\n",
    "\n",
    "precision = precision_score(y_test, y_pred)\n",
    "\n",
    "print(f'Precision: {precision}')\n",
    "\n",
    "# Compute and print recall\n",
    "\n",
    "recall = recall_score(y_test, y_pred)\n",
    "\n",
    "print(f'Recall: {recall}')\n",
    "\n",
    "# Compute and print F1 score\n",
    "\n",
    "f1 = f1_score(y_test, y_pred)\n",
    "\n",
    "print(f'F1 Score: {f1}')\n",
    "\n",
    "print(\"Classification Report:\\n\")\n",
    "\n",
    "print(classification_report(y_test, y_pred),'\\n')\n",
    "\n",
    "print(\"Confusion Matrix:\")\n",
    "\n",
    "cm = confusion_matrix(y_test, y_pred, labels=svm_model.classes_)\n",
    "\n",
    "print(cm)\n",
    "\n",
    "print('\\n\\nFinal Accuracy:', accuracy_score(y_valid, y_pred))\n",
    "\n",
    "# Calculate false alarm and missed detection rates\n",
    "\n",
    "false_alarm_rate = cm[0, 1] / (cm[0, 0] + cm[0, 1])  # False Positives / (Actual Negatives)\n",
    "\n",
    "missed_detection_rate = cm[1, 0] / (cm[1, 0] + cm[1, 1])  # False Negatives / (Actual Positives)\n",
    "\n",
    "print(f\"\\nFalse Alarm Rate: {false_alarm_rate}\")\n",
    "\n",
    "print(f\"\\nMissed Detection Rate: {missed_detection_rate}\")\n",
    "\n",
    "disp = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=svm_model.classes_)\n",
    "\n",
    "disp.plot()\n",
    "\n",
    "plt.show()\n",
    "\n",
    "X_train_forward_roc=X_train.iloc[:, selected_features]\n",
    "\n",
    "y_train_forward_roc=y_train\n",
    "\n",
    "model_train_forward_roc=svm_model\n",
    "\n",
